        style={{
          backgroundImage:
            "url(https://images.unsplash.com/photo-1556228720-195a672e8a03)"
        }}
      >
        {/* Overlay */}
        <div className="absolute inset-0 bg-purple-900/60"></div>

        <div className="relative z-10">
          <h1 className="text-5xl font-bold text-white mb-4">
            Our Services
          </h1>
          <p className="text-purple-100 text-lg">
            Premium beauty treatments crafted for you ‚ú®
          </p>
        </div>
      </section>

      {/* SERVICES GRID */}
      <section className="py-16 px-4">
        <div className="max-w-6xl mx-auto grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">

          {services.map((service, index) => (
            <div
              key={index}
              className="bg-white p-6 rounded-xl shadow hover:shadow-xl transition"
            >
              <h2 className="text-xl font-semibold text-purple-600 mb-2">
                {service.name}
              </h2>

              <p className="text-gray-600">
                ‚è± Duration: {service.duration}
              </p>
              <p className="text-gray-600">
                üí∞ Price: {service.price}
              </p>
              <p className="text-gray-600 mt-2">
                üë©‚Äçüé® Staff: {service.staff}
              </p>

              <button className="mt-4 w-full bg-purple-600 text-white py-2 rounded hover:bg-purple-700 transition">
                Book Now
              </button>
            </div>
          ))}

        </div>
      </section>

    </div>
  );
}
